  const [text, setText] = useState('');

  return (
    <View style={styles.container}>
      <Image
        source={require('./LO.png')}
        style={styles.image}
      />
      <Text>Correo Institucional</Text>
      <TextInput
        style={styles.input}
        onChangeText={setText}
        value={text}
      />
